def histogram(test):
    """
    Given a string representing a space separated lowercase letters, return a dictionary
    of the letter with the most repetition and containing the corresponding count.
    If several letters have the same occurrence, return all of them.

    Example:
    histogram('a b c') == {'a': 1, 'b': 1, 'c': 1}
    histogram('a b b a') == {'a': 2, 'b': 2}
    histogram('a b c a b') == {'a': 2, 'b': 2}
    histogram('b b b b a') == {'b': 4}
    histogram('') == {}
    """

    # Initialize an empty dictionary to store the letter count
    letter_count = {}

    # Split the input string into a list of letters
    letters = test.split()

    # Iterate through each letter in the list and update the count in the dictionary
    for letter in letters:
        if letter in letter_count:
            letter_count[letter] += 1
        else:
            letter_count[letter] = 1

    # Find the maximum count of any letter
    max_count = max(letter_count.values())

    # Create a new dictionary to store the letters with the maximum count
    max_count_letters = {}

    # Iterate through the original dictionary and add the letters with the maximum count to the new dictionary
    for letter, count in letter_count.items():
        if count == max_count:
            max_count_letters[letter] = count

    # Return the dictionary of letters with the maximum count
    return max_count_letters

